/** Point Interface */
export interface Point {
    x: number;
    y: number;
    z: number;
}
/** Single Interface */
export interface Single {
    x: number;
    y: number;
}
/** X Interface */
export interface X {
    y: number;
    z: number;
}
/** Y Interface */
export interface Y {
    x: number;
    z: number;
}
/** Z Interface */
export interface Z {
    x: number;
    y: number;
}
